  // let b = setInterval(generateOtp, 1000);

  return (
    <React.Fragment>
      {/* Static Content */}
      <h1> Welcome to React class</h1>

      {/* Static with Dynamic Content */}
      <h3>
        My name is {fname} {lname}
      </h3>

      {/* Dynamic Content */}
      <h3>
        {num} * {num} = {num * num}
      </h3>
      <h3>
        {num} * {num} = {multiple}
      </h3>

      <h1 style={{ color: "red" }}>OTP :- {generateOtp()}</h1>
      {BasicJsx }
    </React.Fragment>
  );
};

export default App;
